import React, {Component} from "react";
import {Row, Col, Container} from "../Grid";
import Button from "../Button";
import "./style.css"

class ResultBox extends Component {
	render(props) {
			return (
				<Container>
					<div className="border">
						<div className="d-flex justify-content-between">
							<h4 className="m-3">{props.title}</h4>
							<h5 className="m-3">{props.subtitle || ""}</h5>
								<section>
										
										<Button
										// onClick={props.link}
										type="primary"
										>{props.view}
										</Button>

										<Button
										// onClick={props.delOrSave}
										type="primary">
											{props.button2}
										</Button>

								</section>    
						</div>
						<p className="ml-3">{props.authors}</p>
						<p className="ml-3"></p>
						
						<Row>
							<Col size="xs-4 sm-2">
									<img className="test m-3" src={props.image} />
							</Col>
							<Col size="xs-8 sm-9">
									<p>{props.description}
									</p>
							</Col>
						</Row>
					</div>
				</Container>
			)
	}
}

// this.onSumbit = this.onSumbit.bind(this)
// onSubmit = (e) => { console.log(this)} or something like:
// onSubmit = (e) => { alert(this.state.inputValue) } 

export default ResultBox;
